   const dispatch=useDispatch()

    useEffect(() => {
        const {match}=props

       dispatch(getProductsBySlug(match.params.slug))

    }, [])



    return (
        <Layout>
           <div className='card'>
               <div className='cardHeader'></div>
               <div className='cardF'></div>

           </div>
        </Layout>
    )
}
